class Solution(object):

    def non_repeat(self, s, start,end):
        #print (sub)
        for i in range(start,end):
            for j in range(start,end):
                if j != i :
                    if s[i] == s[j]:
                        return False
        return True

    def lengthOfLongestSubstring(self, s):
        le = len(s)
        if le==0:
            return 0
        elif le==1:
            return 1
        for l in range(le,0,-1):
            for sub_c in range(0,le-l+1):
                if self.non_repeat(s,sub_c,sub_c+l):
                    return l


